import React from "react";
import Product from "../components/Product";

const ProductInfo = () => {
  return (
    <div>
      <Product
        key={item.id}
        id={item.id}
        title={item.title}
        price={item.price}
        thumbnail={item.thumbnail}
      />
    </div>
  );
};

export default ProductInfo;
